import { BrowserRouter as Router, Route} from 'react-router-dom';
import Login from './componete/login/login';
import LogoAnimado from './componete/login/logo';
import Logueo from './componete/login/usuario';
import AppLayout from './componete/home/home';
/* import './App.css'; */

function App() {
  return (
    <>
    <Router>
      <Route exact path="/" component={LogoAnimado}/>
      <Route  path="/login" component={Login}/>
      <Route  path="/logueo" component={Logueo}/>
      <Route  path="/pagina" component={AppLayout}/>
    </Router>
    {/* <div className="App">
      <div>
      <Nav></Nav>
      </div>
      <div>
        <Pagina> </Pagina>
      </div>
    </div> */}

    </>
  );
}

export default App;



